import { Index } from "./componentes/index";
import { RealizarCompra } from "./componentes/realizarCompra";

function App() {
    return (
        <Router>
            <div className="App">
                <Switch>
                    <Route exact path="/" component={Index}/>
                </Switch>
            </div>
        </Router>
    );
}

export default App;
